import * as React from "react";
import PropTypes from "prop-types";
import Tabs from "@mui/material/Tabs";
import Tab from "@mui/material/Tab";
import Typography from "@mui/material/Typography";
import Box from "@mui/material/Box";
import ChartBoy from "./ChartBoy";
import ChartGirl from "./ChartGirl";
import { Container } from "@mui/material";

function CustomTabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <>
      <div
        role="tabpanel"
        hidden={value !== index}
        id={`tabpanel-${index}`}
        {...other}
      >
        <p id="chart-time">yyyy.MM.DD Í∏∞Ï§Ä</p>
        {value === index && (
          <Box sx={{ p: 1 }}>
            <Typography>{children}</Typography>
          </Box>
        )}
      </div>
    </>
  );
}

CustomTabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.number.isRequired,
  value: PropTypes.number.isRequired,
};

function a11yProps(index) {
  return {
    id: `simple-tab-${index}`,
    "aria-controls": `simple-tabpanel-${index}`,
  };
}

export default function BasicTabs() {
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const rankBoy = ["NCT Ï†úÎÖ∏1", "NCT Ï†úÎÖ∏2", "NCT Ï†úÎÖ∏3"];
  const rankGirl = ["ÏïÑÏù¥Î∏å ÏõêÏòÅ1", "ÏïÑÏù¥Î∏å ÏõêÏòÅ2", "ÏïÑÏù¥Î∏å ÏõêÏòÅ3"];

  return (
    <Container sx={{ width: "100%" }}>
      <h2>Ïò§ÎäòÏùò Ìè¨Ìè¨Ï∞®Ìä∏ü•á</h2>
      <Box sx={{ borderBottom: 1, borderColor: "divider" }}>
        <Tabs value={value} onChange={handleChange}>
          <Tab
            label="ÎÇ®ÏûêÏïÑÏù¥Îèå"
            {...a11yProps(0)}
            sx={{ fontWeight: value === 0 ? 600 : 400 }}
          />
          <Tab
            label="Ïó¨ÏûêÏïÑÏù¥Îèå"
            {...a11yProps(1)}
            sx={{ fontWeight: value === 1 ? 600 : 400 }}
          />
        </Tabs>
      </Box>
      <CustomTabPanel value={value} index={0}>
        <ChartBoy data={rankBoy} />
      </CustomTabPanel>
      <CustomTabPanel value={value} index={1}>
        <ChartGirl data={rankGirl} />
      </CustomTabPanel>
    </Container>
  );
}
